		).then(function (response) {
			console.log(store.getState());
			store.dispatch(downloadData(response.data.branch));
			console.log(store.getState());
		}).catch(function (error) {
	});
}

callData();
*/

DownloadData();


function Index() {
	return (
		<Provider store={store}>
			<App />
		</Provider>
	)
}



export default Index
